import React from "react";

const Search = () => {
  return (
    <div className="container text-center py-8">
      <input
        type="text"
        className="border-none border rounded-lg bg-slate-200 px-4 py-4"
        placeholder="Search for Images"
      />
      <button className="bg-blue-600 px-4 py-4 text-xl rounded-md mx-4 text-white ">
        Search
      </button>
    </div>
  );
};

export default Search;
